tá pronto para encarar o público de frente, invadir sua praia nesse verão e mostrar que o brasileiro tem muito mais que futebol e samba no pé, \'Temos ritmo, temos pegada, temos o funk\'. O funkeiro já teve outros trabalhos realizados de forma independente, ambos publicados nas redes sociais. Mas é com \'Cheia de charme\', sucesso de Guilherme Arantes, que Danny quer mostrar ao mundo o seu trabalho. Em novembro, ele esteve em Nova York, gravando o clipe da música \"Cheia de Charme\" com a participação, mais que especial, da Miss Universo Leila Lopes. De São Gonçalo para o mundo, Danny quer mostrar o seu estilo unindo classes sociais, ao som do seu sax misturado ao funk, transformando sua maneira de ouvir e dançar o funk!',0,'/images/artista/1101/813a98ea_e88e_44f8_aeba_ef1a9b5fb4d9.jpg',0),(1105,36,18,'Marquinho OSócio','0000-00-00 00:00:00','0000-00-00 00:00:00','','','','O orçamento abaixo será enviado diretamente para o empresário exclusivo do artista ou agente autorizado. Tenha sempre o melhor preço e a segurança de estar negociando direto com os empresários oficiais dos artistas.',0,'/images/artista/1105/cdbf565f_5cec_46b1_b78f_de6f12a89b83.jpg',0),(1109,29,24,'Nicole Bahls','0000-00-00 00:00:00','0000-00-00 00:00:00','','','','Contrate agora para Presença VIP, Desfiles, Campanhas Publicitárias, etc.</P>O orçamento abaixo será enviado diretamente para o empresário exclusivo do artista ou agente autorizado. Tenha sempre o melhor preço e a segurança de estar negociando direto com os empresários oficiais dos artistas.',0,'/images/artista/1109/32ef41b7_b6e7_455c_8d00_2208b02fc716.jpg',0),(1112,29,24,'Yuri Fernandes','0000-00-00 00:00:00','0000-00-00 00:00:00','','','','O orçamento abaixo será enviado diretamente para o empresário exclusivo do artista ou agente autorizado. Tenha sempre o melhor preço e a segurança de estar negociando direto com os empresários oficiais dos artistas.',0,'/images/artista/1112/0e319063_a489_4e2b_9810_8fe66fcba29a.jpg',0),(1113,29,24,'Fr